biography:
Psychologist and Master in Social Psychology, by Instituto de Psicologia, Universidade de São Paulo, Brazil; 
Ph.D. in Environmental Psychology, by University of Arizona, Tucson, USA; 
Full Professor, Graduate Program in Psychology, Universidade Federal do Rio Grande do Norte (UFRN), in Natal, Brazil; 
People-Environment Research Group (UFRN) – Coordinator.

An experienced scientist in cancer research focusing on
-	Assay development for RNA study;
-      Genome editing using CRISPR techniques;
-	NGS RNA-Seq, Guide-Seq; 
-	miRNA/siRNA in cancer
-	Ubiquitin-mediated protein degradation, cell cycle regulation and DNA damage response;
-	Cellular Pharmacology of anticancer drugs
